const { Plugin, openTab, Dialog } = require("siyuan");

function registerIcon(name, size, svg) {
  document.body.insertAdjacentHTML(
    "beforeend",
    `
            <svg style="position: absolute; width: 0; height: 0; overflow: hidden;" xmlns="http://www.w3.org/2000/svg">
                <defs>
                    <symbol id="${name}" viewBox="0 0 ${size} ${size}">
                        ${svg}
                    </symbol>
                </defs>
            </svg>`
  );
}

const i18n = {};

async function readImageAsBase64(fileEl) {
  return new Promise((resolve, reject) => {
    if (typeof FileReader == "undifined") {
      //判断浏览器是否支持filereader
      console.error(i18n.fileReaderUndefined);
      reject(false);
      return;
    }
    const file = fileEl.files[0];
    if (!file) {
      resolve(null);
      return;
    }
    if (!/image\/\w+/.test(file.type)) {
      //判断获取的是否为图片文件
      alert(i18n.ensureImage);
      reject(false);
      return false;
    }
    const reader = new FileReader();
    reader.readAsDataURL(file);
    reader.onload = function (e) {
      const img = new Image();
      img.src = this.result;
      img.onload = () => {
        resolve({
          url: this.result,
          size: Math.min(img.width, img.height),
        });
      };
    };
  });
}

class WebApp {
  name = "";
  iconName = "";
  iconSvg = "";
  iconSymbolSize = 1024;
  title = "";
  isTopBar = false;
  topBarPostion = "right";
  script = "";
  url = "";
  debug = false;

  constructor(options) {
    this.name = options.name || "";
    this.iconName = options.iconName || "";
    this.iconSvg = options.iconSvg || "";
    this.iconSymbolSize = options.iconSymbolSize || 1024;
    this.title = options.title || "";
    this.isTopBar = options.isTopBar || false;
    this.topBarPostion = options.topBarPostion || "right";
    this.url = options.url || "";
    this.script = options.script || "";
    this.loadIcon();
    this.debug = options.debug || false;
  }

  loadIcon() {
    if (this.iconName === 'iconHTML5') {
      return;
    }
    if (!this.iconSymbolSize) {
      return;
    }
    registerIcon(this.iconName, this.iconSymbolSize, this.iconSvg);
  }
}

