class WebAppDock {
  constructor(webAppPlugin) {
    this.webAppPlugin = webAppPlugin;
    this.createIcon();
    this.createDock();
  }

  createIcon() {
    const svg = `
       <path d="M371.733 94.172q25.773 0 44.112 17.843t18.339 43.617v247.822q0 25.773-18.339 44.112t-44.112 18.34H123.91q-25.774 0-43.617-18.34t-17.843-44.112V155.632q0-25.773 17.843-43.617t43.617-17.843h247.822z m0 495.644q25.773 0 44.112 17.843t18.339 43.617v248.813q0 25.774-18.339 43.617t-44.112 17.843H123.91q-25.774 0-43.617-17.843t-17.843-43.617V651.276q0-25.774 17.843-43.617t43.617-17.843h247.822z m496.635 0q25.773 0 43.617 17.843t17.843 43.617v248.813q0 25.774-17.843 43.617t-43.617 17.843H620.546q-25.773 0-44.112-17.843t-18.34-43.617V651.276q0-25.774 18.34-43.617t44.112-17.843h247.822z m137.789-386.602q19.826 19.826 19.826 46.59t-19.826 45.6l-184.38 184.38q-19.825 19.825-46.095 19.825t-46.094-19.826l-184.38-184.38q-18.834-18.834-18.834-45.599t18.834-46.59l184.38-184.38Q749.413 0 775.682 0t46.095 18.834z"></path>
        `;
    registerIcon("iconWebApp", "1024", svg);
  }

  createDock() {
    const dock = this;
    const plugin = this.webAppPlugin;
    this.webAppPlugin.addDock({
      config: {
        position: "LeftBottom",
        size: { width: 200, height: 0 },
        icon: "iconWebApp",
        title: plugin.i18n.title,
      },
      data: {
        apps: this.webAppPlugin.apps,
      },
      type: "WebAppDock",
      init() {
        const render = () => {
          this.element.innerHTML = `
          <div class="fn__flex-1 fn__flex-column">
                    <div class="block__icons">
                        <div class="block__logo">
                            <svg><use xlink:href="#iconWebApp"></use></svg>
                            ${i18n.title}
                        </div>
                        <span class="fn__flex-1 fn__space"></span>
                        <span data-type="min" class="block__icon b3-tooltips b3-tooltips__sw" aria-label="${i18n.min}"><svg><use xlink:href="#iconMin"></use></svg></span>
                        <span id="add-webapp" class="block__icon b3-tooltips b3-tooltips__sw" aria-label="${i18n.create}"><svg><use xlink:href="#iconAdd"></use></svg></span>
                    </div>
                    
                    <div class="fn__flex-1 plugin-webapp_custom-dock">
                        ${this.data.apps
                          .map((app) => {
                            return `<div class="webapp" style="display: flex; align-items: center; gap: 3px;" data-name="${
                              app.name
                            }">
                                <svg><use xlink:href="#${
                                  app.iconName
                                }"></use></svg>
                                <span style="flex: 1">${app.title}
                                ${
                                  app.script ? `<span class="b3-tooltips b3-tooltips__e"  aria-label="${i18n.hasScript}"><svg><use xlink:href="#iconSparkles"></use></svg></span>` : ''
                                }
                                ${
                                  app.debug ? `<span class="b3-tooltips b3-tooltips__e"  aria-label="${i18n.hasDebug}"><svg><use xlink:href="#iconBug"></use></svg></span>` : ''
                                }
                                </span>
                                ${
                                  plugin.docksConfig.some((v) => v === app.name)
                                    ? ""
                                    : `<span class="func-btn adddock b3-tooltips b3-tooltips__w" aria-label="${i18n.addToDock}" data-name="${app.name}"><svg><use xlink:href="#iconDock"></use></svg></span>`
                                }
                                ${
                                  plugin.docksConfig.some((v) => v === app.name)
                                    ? `<span class="func-btn deletedock b3-tooltips b3-tooltips__w" aria-label="${i18n.deleteDock}" data-name="${app.name}"><svg><use xlink:href="#iconHideDock"></use></svg></span>`
                                    : ""
                                }
                                ${
                                  plugin.setting.homepage !== app.name
                                    ? `<span class="func-btn homepageapp b3-tooltips b3-tooltips__w" aria-label="${i18n.setAsHomepage}" data-name="${app.name}"><svg><use xlink:href="#iconLanguage"></use></svg></span>`
                                    : ""
                                }
                                ${
                                  app.internal
                                    ? ""
                                    : `<span class="func-btn deleteapp b3-tooltips b3-tooltips__w" aria-label="${i18n.removeApp}" data-name="${app.name}"><svg><use xlink:href="#iconTrashcan"></use></svg></span>`
                                }
                            </div>`;
                          })
                          .join("")}
                    </div>
                </div>`;

          function onClick(element, classname, callback) {
            const homepageapp = element.querySelectorAll(`.${classname}`);
            for (const del of homepageapp) {
              del.addEventListener("click", (e) => {
                e.preventDefault();
                e.stopPropagation();
                let target;
                const p = e.path || (e.composedPath && e.composedPath());
                for (const f of p) {
                  if (f.classList.contains(classname)) {
                    target = f;
                    break;
                  }
                }
                if (!target) {
                  return;
                }
                const name = target.getAttribute("data-name");
                callback(name);
              });
            }
          }
          onClick(this.element, "webapp", (name) => {
            const app = this.data.apps.find((v) => v.name === name);
            if (app) {
              app.openTab();
            }
          });
          onClick(this.element, "deleteapp", (name) => plugin.remove(name));
          onClick(this.element, "adddock", (name) => plugin.initDock(name));
          onClick(this.element, "deletedock", (name) =>
            plugin.removeDock(name)
          );
          onClick(this.element, "homepageapp", (name) =>
            plugin.setHomepage(name)
          );

          const add = this.element.querySelector("#add-webapp");
          add.addEventListener("click", () => dock.addWebApp());
        };

        dock.el = this.element;
        dock.render = render;

        render();
      },
    });
  }

  refresh() {
    this.render && this.render();
  }

  addWebApp() {
    const dock = this;
    const plugin = this.webAppPlugin;
    const dialog = new Dialog({
      title: i18n.dialogAdd,
      content: `
            <div class="b3-dialog__content">
                <div class="b3-dialog-input">
                <label for="appname">${i18n.appname}</label>
                <input class="b3-text-field fn__block" type="input" name="appname" id="appname"/>
                </div>
                <div class="b3-dialog-input">
                <label for="appurl">URL</label>
                <input class="b3-text-field fn__block" type="input" name="appurl"  id="appurl"/>
                </div>
                <div class="b3-dialog-input">
                <label for="appfile">LOGO</label>
                <input class="fn__block" type="file" name="appfile"  id="appfile"/>
                </div>
            </div>
            <div class="b3-dialog__content">
            <p>${i18n.attention}</p>
            </div>
            <div class="b3-dialog__action">
                <button class="b3-button b3-button--cancel">${i18n.cancel}</button><div class="fn__space"></div>
                <button class="b3-button b3-button--text">${i18n.add}</button>
            </div>`,
      width: "520px",
    });
    const nameEl = dialog.element.querySelector("#appname");
    const urlEl = dialog.element.querySelector("#appurl");
    const fileEl = dialog.element.querySelector("#appfile");

    const btnsElement = dialog.element.querySelectorAll(".b3-button");
    // inputElement.focus();
    btnsElement[0].addEventListener("click", () => {
      dialog.destroy();
    });
    btnsElement[1].addEventListener("click", async () => {
      try {
        const res = await readImageAsBase64(fileEl);
        const name = nameEl.value;
        const options = {
          name: name,
          iconName: res ? `icon${name}` : 'iconHTML5',
          iconSvg: res ? `<image href="${res.url}" />` : '',
          iconSymbolSize: res ? res.size : 0,
          title: name,
          isTopBar: true,
          topBarPostion: "right",
          url: urlEl.value,
        };
        plugin.addApp(options);
        dialog.destroy();
        dock.refresh();
      } catch (e) {
        console.error(e);
        return;
      }
    });
  }

  save(options) {
    this.webAppPlugin.addApp(options);
  }
}

const renderView = (context) => {
  context.element.innerHTML = `<div style="display: flex" class="fn__flex-column fn__flex fn__flex-1 ${context.data.name}__custom-tab">
                        <webview allowfullscreen allowpopups style="border: none" class="fn__flex-column fn__flex  fn__flex-1" src="${context.data.url}"></webview>
                    </div>`;
  const webview = context.element.querySelector("webview");
  if (context.data.script) {
    webview.addEventListener("load-commit", () => {
      const ps = webview.executeJavaScript(context.data.script);
      if (context.data.debug);
      ps.then(console.log);
    });
  }

  if (context.data.debug) {
    webview.addEventListener("dom-ready", () => {
      webview.openDevTools();
    });
  }

  const panel = context.element.querySelector(
    `.${context.data.name}__custom-tab`
  );

  function hideOverlayer() {
    panel.querySelector(".overlayer")
      ? panel.querySelector(".overlayer").remove()
      : null;
  }
  function showOverLayer() {
    if (!panel.querySelector(".overlayer")) {
      let div = document.createElement("div");
      div.setAttribute(
        "style",
        `position:absolute;bottom:0;left:0;height:${panel.clientHeight}px;width:100%`
      );
      div.setAttribute("class", "overlayer");
      div.addEventListener("mousedown", () => {
        siyuanMenu.close();
      });
      panel.appendChild(div);
    }
  }
  document.addEventListener(
    "mousedown",
    () => {
      showOverLayer();
    },
    true
  );
  document.addEventListener(
    "mouseup",
    () => {
      hideOverlayer();
    },
    true
  );
};


module.exports = class WebAppPlugin extends Plugin {
  constructor(args) {
    super(args);
    this.webAppDock = new WebAppDock(this);
  }
  apps = [flomo, cubox, dida];

  setting = {
    homepage: "",
  };

  appsConfig = [];

  docksConfig = [];

  async onload() {
    Object.assign(i18n, this.i18n);
    this.apps.forEach((app) => (app.internal = true));
    await this.initStorage();
    this.apps.forEach((app) => this.loadApp(app));
    for (const dockname of this.docksConfig) {
      await this.initDock(dockname);
    }
    this.webAppDock.refresh();
  }

  onLayoutReady() {
    this.initEmptyPage();
  }

  async initStorage() {
    const data = await this.loadData("apps.txt");
    if (!data) {
      await this.saveData("apps.txt", "[]");
    } else {
      try {
        const arr = JSON.parse(data);
        arr.forEach((conf) => {
          this.appsConfig.push(conf);
          this.apps.push(new WebApp(conf));
        });
      } catch (e) {
        console.error(this.i18n.parseFail, e);
      }
    }
    const docksConfig = await this.loadData("docks.json");
    if (!docksConfig) {
      await this.saveData("docks.json", []);
    } else {
      this.docksConfig = docksConfig;
    }
    const config = await this.loadData("setting.json");
    if (config) {
      this.setting = Object.assign(this.setting, config);
    }
  }

  async updateStorage() {
    const s = JSON.stringify(this.appsConfig, null, 2);
    await this.saveData("apps.txt", s);
    await this.saveData("docks.json", this.docksConfig);
    await this.saveData("setting.json", this.setting);
  }

  addApp(options) {
    const app = new WebApp(options);
    this.loadApp(app);
    this.apps.push(app);
    this.appsConfig.push(options);
    this.updateStorage();
  }

  async remove(name) {
    const i = this.apps.findIndex((v) => v.name === name);
    if (i >= 0) {
      this.apps.splice(i, 1);
    }
    const j = this.appsConfig.findIndex((v) => v.name === name);
    if (j >= 0) {
      this.appsConfig.splice(j, 1);
    }
    const k = this.docksConfig.findIndex((v) => v === name);
    if (k >= 0) {
      this.docksConfig.splice(k, 1);
    }
    await this.updateStorage();
    this.webAppDock.refresh();
  }

  loadApp(app) {
    if (app.isTopBar) {
      const tab = this.addTab({
        type: app.name,
        init() {
          renderView(this);
        },
      });
      app.openTab = () =>
        openTab({
          custom: {
            icon: app.iconName,
            title: app.title,
            data: {
              name: app.name,
              url: app.url,
              script: app.script,
              debug: app.debug,
            },
            fn: tab,
          },
        });
      return;
    }
  }

  async initDock(dockname) {
    const app = this.apps.find((d) => d.name === dockname);
    if (!app) {
      return null;
    }
    this.addDock({
      config: {
        position: "RightTop",
        size: { width: 200, height: 0 },
        icon: app.iconName,
        title: app.title,
      },
      data: {
        name: app.name,
        url: app.url,
        script: app.script,
        debug: app.debug,
      },
      type: `${this.name}_${app.name}`,
      init() {
        renderView(this);
      },
    });
    if (this.docksConfig.find((a) => a === app.name)) {
      return;
    }
    this.docksConfig.push(app.name);
    await this.updateStorage();
    window.location.reload();
  }

  async removeDock(dockname) {
    const i = this.docksConfig.findIndex((v) => v === dockname);
    console.log(dockname, i);
    if (i >= 0) {
      this.docksConfig.splice(i, 1);
      await this.updateStorage();
      window.location.reload();
    }
  }

  updateEmptyPage(el = document) {
    const empty = el.querySelector(".layout__empty");
    if (!empty) {
      return;
    }
    if (this.setting.homepage) {
      const app = this.apps.find((v) => v.name === this.setting.homepage);
      if (!app) {
        return;
      }
      renderView({
        element: empty,
        data: app,
      });
      empty.children[0]?.setAttribute("style", "width: 100%");
    }
  }

  async setHomepage(name) {
    if (this.setting.homepage === name) {
      this.setting.homepage = '';
      await this.updateStorage();
      window.location.reload();
    } else {
      this.setting.homepage = name;
      this.updateStorage();
      this.updateEmptyPage();
    }
  }

  initEmptyPage() {
    const targetNode = document.querySelector(".layout__center");
    const config = { attributes: true, childList: true, subtree: true };
    const callback = (mutationsList, observer) => {
      // Use traditional 'for loops' for IE 11
      for (let mutation of mutationsList) {
        if (mutation.type === "childList") {
          this.updateEmptyPage(mutation.target);
        }
      }
    };
    const observer = new MutationObserver(callback);
    observer.observe(targetNode, config);
    // one shot update
    this.updateEmptyPage();
  }
};
